import React, { useEffect, useState } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import './ResultPage.css';

function ResultPage() {
  const location = useLocation();
  const navigate = useNavigate();
  const [results, setResults] = useState(null);
  const [animatedScore, setAnimatedScore] = useState(0);

  useEffect(() => {
    if (location.state && location.state.results) {
      setResults(location.state.results);
    } else {
      navigate('/');
    }
  }, [location, navigate]);

  useEffect(() => {
    if (results) {
      // Animate score counter
      const duration = 2000;
      const steps = 60;
      const increment = results.overallScore / steps;
      let current = 0;
      
      const timer = setInterval(() => {
        current += increment;
        if (current >= results.overallScore) {
          setAnimatedScore(results.overallScore);
          clearInterval(timer);
        } else {
          setAnimatedScore(Math.floor(current));
        }
      }, duration / steps);

      return () => clearInterval(timer);
    }
  }, [results]);

  if (!results) {
    return (
      <div className="result-page">
        <div className="loading-container">
          <div className="loading-spinner"></div>
          <p>Generating your results...</p>
        </div>
      </div>
    );
  }

  const { overallScore, skillBreakdown, strengths, improvements, suggestions, answers } = results;
  const companyId = location.state?.companyId || 'google';

  const getScoreColor = (score) => {
    if (score >= 80) return '#4caf50';
    if (score >= 60) return '#ff9800';
    return '#f44336';
  };

  const getScoreGrade = (score) => {
    if (score >= 90) return 'A+';
    if (score >= 80) return 'A';
    if (score >= 70) return 'B+';
    if (score >= 60) return 'B';
    if (score >= 50) return 'C';
    return 'D';
  };

  const isSelected = overallScore >= 70;
  const totalQuestions = answers?.length || 0;
  const avgAnswerLength = answers?.reduce((sum, a) => sum + (a.answer?.length || 0), 0) / totalQuestions || 0;

  const CircularProgress = ({ score, size = 180 }) => {
    const radius = (size - 30) / 2;
    const circumference = 2 * Math.PI * radius;
    const offset = circumference - (score / 100) * circumference;

    return (
      <div className="circular-progress-wrapper">
        <div className="circular-progress" style={{ width: size, height: size }}>
          <svg width={size} height={size} className="progress-svg">
            <defs>
              <linearGradient id="progressGradient" x1="0%" y1="0%" x2="100%" y2="100%">
                <stop offset="0%" stopColor={getScoreColor(score)} />
                <stop offset="100%" stopColor={getScoreColor(score)} stopOpacity="0.7" />
              </linearGradient>
            </defs>
            <circle
              cx={size / 2}
              cy={size / 2}
              r={radius}
              stroke="rgba(163, 186, 172, 0.2)"
              strokeWidth="20"
              fill="none"
              className="progress-circle-bg"
            />
            <circle
              cx={size / 2}
              cy={size / 2}
              r={radius}
              stroke="url(#progressGradient)"
              strokeWidth="20"
              fill="none"
              strokeDasharray={circumference}
              strokeDashoffset={offset}
              className="progress-circle"
              transform={`rotate(-90 ${size / 2} ${size / 2})`}
              strokeLinecap="round"
            />
          </svg>
          <div className="progress-text">
            <span className="progress-score">{animatedScore}</span>
            <span className="progress-label">/100</span>
            <span className="progress-grade">{getScoreGrade(score)}</span>
          </div>
        </div>
      </div>
    );
  };

  return (
    <div className="result-page">
      <div className="result-background">
        <div className="bg-pattern"></div>
      </div>
      
      <div className="result-container">
        {/* Header with Congratulations/Better Luck */}
        <div className={`result-header ${isSelected ? 'selected' : 'not-selected'}`}>
          <div className="header-icon">
            {isSelected ? 'üéâ' : 'üí™'}
          </div>
          <h1 className="result-title">
            {isSelected ? 'Congratulations!' : 'Better Luck Next Time!'}
          </h1>
          <p className="result-subtitle">
            {isSelected 
              ? `You scored ${overallScore}% and have been selected! Your performance was outstanding.`
              : `You scored ${overallScore}%. Keep practicing to improve your interview skills.`
            }
          </p>
        </div>

        {/* Score Section */}
        <div className="overall-score-section">
          <div className="score-header">
            <h2>Your Overall Score</h2>
            <div className="score-badge">{getScoreGrade(overallScore)}</div>
          </div>
          <CircularProgress score={overallScore} />
          <div className="score-stats">
            <div className="stat-item">
              <span className="stat-value">{totalQuestions}</span>
              <span className="stat-label">Questions</span>
            </div>
            <div className="stat-item">
              <span className="stat-value">{Math.round(avgAnswerLength)}</span>
              <span className="stat-label">Avg Words</span>
            </div>
            <div className="stat-item">
              <span className="stat-value">{getScoreGrade(overallScore)}</span>
              <span className="stat-label">Grade</span>
            </div>
          </div>
        </div>

        {/* Skill Breakdown */}
        <div className="skill-breakdown-section">
          <h2 className="section-title">
            <span className="title-icon">üìä</span>
            Skill Breakdown
          </h2>
          <div className="skill-grid">
            <div className="skill-card">
              <div className="skill-header">
                <div className="skill-icon">üí¨</div>
                <div className="skill-info">
                  <div className="skill-label">Communication</div>
                  <div className="skill-score">{skillBreakdown.communication}%</div>
                </div>
              </div>
              <div className="skill-bar-container">
                <div
                  className="skill-bar"
                  style={{
                    width: `${skillBreakdown.communication}%`,
                    backgroundColor: getScoreColor(skillBreakdown.communication)
                  }}
                />
              </div>
            </div>
            <div className="skill-card">
              <div className="skill-header">
                <div className="skill-icon">üéØ</div>
                <div className="skill-info">
                  <div className="skill-label">Confidence</div>
                  <div className="skill-score">{skillBreakdown.confidence}%</div>
                </div>
              </div>
              <div className="skill-bar-container">
                <div
                  className="skill-bar"
                  style={{
                    width: `${skillBreakdown.confidence}%`,
                    backgroundColor: getScoreColor(skillBreakdown.confidence)
                  }}
                />
              </div>
            </div>
            <div className="skill-card">
              <div className="skill-header">
                <div className="skill-icon">‚öôÔ∏è</div>
                <div className="skill-info">
                  <div className="skill-label">Technical Clarity</div>
                  <div className="skill-score">{skillBreakdown.technicalClarity}%</div>
                </div>
              </div>
              <div className="skill-bar-container">
                <div
                  className="skill-bar"
                  style={{
                    width: `${skillBreakdown.technicalClarity}%`,
                    backgroundColor: getScoreColor(skillBreakdown.technicalClarity)
                  }}
                />
              </div>
            </div>
          </div>
        </div>

        {/* Strengths and Improvements Side by Side */}
        <div className="feedback-grid">
          <div className="strengths-section">
            <div className="section-header">
              <span className="section-icon">‚ú®</span>
              <h2>Your Strengths</h2>
            </div>
            <ul className="strengths-list">
              {strengths.length > 0 ? (
                strengths.map((strength, index) => (
                  <li key={index} className="feedback-item">
                    <span className="check-icon">‚úì</span>
                    {strength}
                  </li>
                ))
              ) : (
                <li className="feedback-item no-items">No specific strengths identified</li>
              )}
            </ul>
          </div>

          <div className="improvements-section">
            <div className="section-header">
              <span className="section-icon">üìà</span>
              <h2>Areas for Improvement</h2>
            </div>
            <ul className="improvements-list">
              {improvements.length > 0 ? (
                improvements.map((improvement, index) => (
                  <li key={index} className="feedback-item">
                    <span className="arrow-icon">‚Üí</span>
                    {improvement}
                  </li>
                ))
              ) : (
                <li className="feedback-item no-items">Great job! Keep up the excellent work!</li>
              )}
            </ul>
          </div>
        </div>

        {/* Suggestions */}
        <div className="suggestions-section">
          <div className="section-header">
            <span className="section-icon">üí°</span>
            <h2>Recommendations for Next Time</h2>
          </div>
          <div className="suggestions-grid">
            {suggestions.map((suggestion, index) => (
              <div key={index} className="suggestion-card">
                <div className="suggestion-number">{index + 1}</div>
                <p>{suggestion}</p>
              </div>
            ))}
          </div>
        </div>

        {/* Action Buttons */}
        <div className="result-actions">
          <button
            className="retry-btn"
            onClick={() => navigate(`/interview/${companyId}`)}
          >
            <span className="btn-icon">üîÑ</span>
            Retry Interview
          </button>
          <button
            className="home-btn"
            onClick={() => navigate('/')}
          >
            <span className="btn-icon">üè†</span>
            Back to Companies
          </button>
          <button
            className="share-btn"
            onClick={() => {
              const text = `I scored ${overallScore}% in my virtual AI interview! ${isSelected ? 'Got selected! üéâ' : 'Keep practicing! üí™'}`;
              if (navigator.share) {
                navigator.share({ text });
              } else {
                navigator.clipboard.writeText(text);
                alert('Results copied to clipboard!');
              }
            }}
          >
            <span className="btn-icon">üì§</span>
            Share Results
          </button>
        </div>
      </div>
    </div>
  );
}

export default ResultPage;
